    public class Feature
    {
        public int maxResults { get; set; }
        public string type { get; set; }
    }

    public class Image
    {
        public string content { get; set; }
    }

    public class CropHintsParams
    {
        public List<double> aspectRatios { get; set; }
    }

    public class ImageContext
    {
        public CropHintsParams cropHintsParams { get; set; }
    }

    public class Request
    {
        public List<Feature> features { get; set; }
        public Image image { get; set; }
        public ImageContext imageContext { get; set; }
    }

    public class GoogleOCRRequest
    {
        public List<Request> requests { get; set; }
    }

    public class OCRResult
    {
        public Parsedresult[] ParsedResults { get; set; }
        public int OCRExitCode { get; set; }
        public bool IsErroredOnProcessing { get; set; }
        public string ErrorMessage { get; set; }
        public string ErrorDetails { get; set; }
    }
    public class Parsedresult
    {
        public object FileParseExitCode { get; set; }
        public string ParsedText { get; set; }
        public string ErrorMessage { get; set; }
        public string ErrorDetails { get; set; }
    }



    class OCRHelper
    {
        private static string ResultJsonString = "";
        private static string ResultTextString = "";

        public static GoogleOCRRequest BuildRequest(byte[] imageData)
        {
            GoogleOCRRequest batchRequest = new GoogleOCRRequest();
            batchRequest.requests = new List<Request>();
            batchRequest.requests.Add(new Request()
            {
                features = new List<Feature>() { new Feature() { type = "DOCUMENT_TEXT_DETECTION", maxResults = 1 }, },
                imageContext = new ImageContext() { cropHintsParams = new CropHintsParams() { aspectRatios = new List<double>() { 0.8, 1, 1.2 } } },
                image = new Image()
                {
                    content = ""
                    //content = Convert.ToBase64String(imageData)
                }
            });

            return batchRequest;

        }

        public static async Task<GoogleOCRResponse> GetOCRResult(GoogleOCRRequest request)
        {
            GoogleOCRResponse ocrResponse = null;
            try
            {
                var jsonString = JsonConvert.SerializeObject(request);
                var content = new StringContent(jsonString, Encoding.UTF8, "application/json");
                var client = new HttpClient();
                string url = "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyCq1GZrP0m7KNei13BF-PcIRucuLz12KLw";

                var response = client.PostAsync(url, content).Result;

                string jsonResponse = response.Content.ReadAsStringAsync().Result;

                ocrResponse = JsonConvert.DeserializeObject<GoogleOCRResponse>(jsonResponse);
            }
            catch (Exception exception)
            {

            }

            return ocrResponse;
            //return new OCRResult();

        }
